  ,\n       \"ProdReportingBusinessUnit\" as \"ProductReportingBusinessUnit\",\n \
  \      \"ProdDefaultMetricName\" as \"ProductDefaultMetricName\",\n       \"ProdStatusCodeName\"\
  \ as \"ProductStatusCodeName\"\nFROM\n  (SELECT \"ProdNumber\" as \"ProdNumber\"\
  ,\n          \"ProdSysID\" as \"ProdSysID\",\n          \"ProdStatusCode\" as \"\
  ProdStatusCode\",\n          \"ProdName\" as \"ProdName\",\n          \"SN_PRODUCTCATEGORYNAME\"\
  \ as \"ProdCategory\",\n          \"SN_REPORTINGPRODUCTBUSINESSUNITNAME\" as \"\
  ProdReportingBusinessUnit\",\n          \"SN_DEFAULTMETRICPRODUCTNAME\" as \"ProdDefaultMetricName\"\
  ,\n          \"STATUSCODENAME\" as \"ProdStatusCodeName\"\n   FROM\n     (SELECT\
  \ \"PRODUCTNUMBER\" as \"ProdNumber\",\n             \"PRODUCTID\" as \"ProdSysID\"\
  ,\n             \"STATUSCODE\" as \"ProdStatusCode\",\n             \"NAME\" as\
  \ \"ProdName\",\n             \"SN_PRODUCTCATEGORYNAME\" as \"SN_PRODUCTCATEGORYNAME\"\
  ,\n             \"SN_REPORTINGPRODUCTBUSINESSUNITNAME\" as \"SN_REPORTINGPRODUCTBUSINESSUNITNAME\"\
  ,\n             \"SN_DEFAULTMETRICPRODUCTNAME\" as \"SN_DEFAULTMETRICPRODUCTNAME\"\
  ,\n             \"STATUSCODENAME\" as \"STATUSCODENAME\"\n      FROM \"RDS\".\"\
  DYNAMICS365\".\"PRODUCTS\")\"Projection_1\")Projection_3;"
